import mealsImage from '../../assests/Reactmeals.jpg';
import classes from './Header.module.css';

const Header = props => {
  return (
    <>
        <header className={classes.header}>
            <h1>React Meals</h1>
            <button>Cart</button>
        </header>
        <div className={classes['main-image']}>
            <img src={mealsImage} alt='table full of fruits'/>
        </div>
    </>
  )
};

export default Header;
